    habitats is a key area of study for the Alaska Fisheries Science Center. In order
    to accurately estimate abundance knowledge of rockfish response to the observation
    platform must be known. In 2013, we performed a series of experiments to examine
    rockfish response to a stereo drop camera. These data area stored as image files,
